import React from "react";

function EmployeeDetail(props) {
  return (
    <tr className="text-center">
      <td>{props.picture}</td>
      <td>{props.firstName}</td>
      <td>{props.lastName}</td>
      <td>{props.email}</td>
      <td>{props.phone}</td>
      <td>{props.city}</td>
      <td>{props.key}</td>
    </tr>
  );
}

console.log(EmployeeDetail);

export default EmployeeDetail;
